svg.script:
function toggleLayer(e,n) {
  var l = document.getElementById(n);
  var state = l.getAttributeNS(null,"style");
  if (state == "display:inline") {
    l.setAttributeNS(null,"style","display:none");
    e.target.setAttributeNS(null,"style","font-size:14px;fill:red");
  } else {
    l.setAttributeNS(null,"style","display:inline");
    e.target.setAttributeNS(null,"style","font-size:14px;fill:black");
  }
}
